import React, { useState, useEffect } from 'react';
import { Card, Row, Col, Timeline, Tabs, Spin, Alert, Button, Modal, Input, Tag, Statistic, Progress } from 'antd';
import { SearchOutlined, HeartOutlined, UserOutlined, CalendarOutlined, TeamOutlined } from '@ant-design/icons';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, BarChart, Bar, PieChart, Pie, Cell } from 'recharts';
import { eventAPI } from '../services/api';
import EventCard from './EventCard';
import DecisionModal from './DecisionModal';
import MemberProfileCard from './MemberProfileCard';
import moment from 'moment';

const { TabPane } = Tabs;
const { Search } = Input;

const Dashboard = () => {
  const [loading, setLoading] = useState(true);
  const [events, setEvents] = useState([]);
  const [decisions, setDecisions] = useState([]);
  const [memberProgress, setMemberProgress] = useState({});
  const [travelTimeline, setTravelTimeline] = useState([]);
  const [diagnostics, setDiagnostics] = useState([]);
  const [exerciseRefreshes, setExerciseRefreshes] = useState([]);
  const [teamActivity, setTeamActivity] = useState({});
  const [memberProfile, setMemberProfile] = useState({});
  const [selectedDecision, setSelectedDecision] = useState(null);
  const [selectedEvent, setSelectedEvent] = useState(null);
  const [searchResults, setSearchResults] = useState([]);
  const [searching, setSearching] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      setLoading(true);
      const [
        eventsRes,
        decisionsRes,
        progressRes,
        travelRes,
        diagnosticsRes,
        exerciseRes,
        teamRes,
        profileRes
      ] = await Promise.all([
        eventAPI.getEvents({ limit: 50 }),
        eventAPI.getDecisions(),
        eventAPI.getMemberProgress(),
        eventAPI.getTravelTimeline(),
        eventAPI.getDiagnostics(),
        eventAPI.getExerciseRefreshes(),
        eventAPI.getTeamActivity(),
        eventAPI.getMemberProfile()
      ]);

      setEvents(eventsRes.data);
      setDecisions(decisionsRes.data);
      setMemberProgress(progressRes.data);
      setTravelTimeline(travelRes.data);
      setDiagnostics(diagnosticsRes.data);
      setExerciseRefreshes(exerciseRes.data);
      setTeamActivity(teamRes.data);
      setMemberProfile(profileRes.data);
    } catch (err) {
      setError('Failed to load dashboard data');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = async (query) => {
    if (!query.trim()) {
      setSearchResults([]);
      return;
    }

    try {
      setSearching(true);
      const response = await eventAPI.searchEvents(query);
      setSearchResults(response.data);
    } catch (err) {
      console.error('Search failed:', err);
    } finally {
      setSearching(false);
    }
  };

  const handleDecisionClick = (decision) => {
    setSelectedDecision(decision);
  };

  const handleEventClick = (event) => {
    setSelectedEvent(event);
  };

  const formatChartData = (data) => {
    return data.map(item => ({
      ...item,
      date: moment(item.timestamp).format('MMM DD')
    }));
  };

  const getPriorityColor = (priority) => {
    const colors = {
      'High': '#ff4d4f',
      'Medium': '#faad14',
      'Low': '#52c41a'
    };
    return colors[priority] || '#d9d9d9';
  };

  const getActorColors = () => [
    '#8884d8', '#82ca9d', '#ffc658', '#ff7300', '#8dd1e1', '#d084d0'
  ];

  if (loading) return <div style={{ textAlign: 'center', padding: '50px' }}><Spin size="large" /></div>;
  if (error) return <Alert message="Error" description={error} type="error" showIcon />;

  return (
    <div style={{ padding: '24px' }}>
      {/* Header Stats */}
      <Row gutter={16} style={{ marginBottom: 24 }}>
        <Col span={6}>
          <Card>
            <Statistic
              title="Total Events"
              value={memberProgress.total_events}
              prefix={<CalendarOutlined />}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card>
            <Statistic
              title="Decisions Made"
              value={memberProgress.total_decisions}
              prefix={<HeartOutlined />}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card>
            <Statistic
              title="HRV Issues"
              value={memberProgress.hrv_issues}
              valueStyle={{ color: memberProgress.hrv_issues > 10 ? '#cf1322' : '#3f8600' }}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card>
            <Statistic
              title="Travel Periods"
              value={memberProgress.travel_periods}
              prefix={<UserOutlined />}
            />
          </Card>
        </Col>
      </Row>

      {/* Search */}
      <Card style={{ marginBottom: 24 }}>
        <Search
          placeholder="Search conversations, decisions, or events..."
          allowClear
          enterButton={<SearchOutlined />}
          size="large"
          onSearch={handleSearch}
          loading={searching}
        />
        {searchResults.length > 0 && (
          <div style={{ marginTop: 16 }}>
            <h4>Search Results ({searchResults.length})</h4>
            <Row gutter={[16, 16]}>
              {searchResults.slice(0, 6).map(event => (
                <Col span={8} key={event.id}>
                  <EventCard 
                    event={event} 
                    onClick={handleEventClick}
                    showDecisionIndicator={true}
                  />
                </Col>
              ))}
            </Row>
          </div>
        )}
      </Card>

      <Tabs defaultActiveKey="1">
        <TabPane tab="Overview" key="1">
          <Row gutter={16}>
            {/* Member Profile */}
            <Col span={8}>
              <MemberProfileCard profile={memberProfile} />
            </Col>

            {/* Progress Charts */}
            <Col span={16}>
              <Card title="Health Metrics Trends" style={{ marginBottom: 16 }}>
                {memberProgress.sleep_data && memberProgress.sleep_data.length > 0 ? (
                  <ResponsiveContainer width="100%" height={200}>
                    <LineChart data={formatChartData(memberProgress.sleep_data)}>
                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis dataKey="date" />
                      <YAxis />
                      <Tooltip />
                      <Line type="monotone" dataKey="value" stroke="#8884d8" name="Sleep (hours)" />
                    </LineChart>
                  </ResponsiveContainer>
                ) : (
                  <div style={{ textAlign: 'center', padding: 40 }}>No sleep data available</div>
                )}
              </Card>

              <Card title="Adherence Tracking">
                {memberProgress.adherence_data && memberProgress.adherence_data.length > 0 ? (
                  <ResponsiveContainer width="100%" height={200}>
                    <BarChart data={formatChartData(memberProgress.adherence_data)}>
                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis dataKey="date" />
                      <YAxis />
                      <Tooltip />
                      <Bar dataKey="value" fill="#82ca9d" name="Adherence %" />
                    </BarChart>
                  </ResponsiveContainer>
                ) : (
                  <div style={{ textAlign: 'center', padding: 40 }}>No adherence data available</div>
                )}
              </Card>
            </Col>
          </Row>
        </TabPane>

        <TabPane tab="Decisions & Rationale" key="2">
          <Card title={`Key Decisions (${decisions.length})`}>
            <Row gutter={[16, 16]}>
              {decisions.map(decision => (
                <Col span={24} key={decision.event_id}>
                  <Card 
                    size="small" 
                    hoverable
                    onClick={() => handleDecisionClick(decision)}
                    style={{ cursor: 'pointer' }}
                  >
                    <Row>
                      <Col span={18}>
                        <div style={{ marginBottom: 8 }}>
                          <Tag color="blue">{decision.actor.sender}</Tag>
                          <Tag color={getPriorityColor(decision.priority)}>{decision.priority}</Tag>
                          <span style={{ color: '#666', fontSize: '12px' }}>
                            {moment(decision.timestamp).format('MMM DD, YYYY HH:mm')}
                          </span>
                        </div>
                        <div style={{ fontWeight: 'bold', marginBottom: 4 }}>
                          {decision.rationale || 'Decision made'}
                        </div>
                        <div style={{ color: '#666', fontSize: '12px' }}>
                          {decision.context?.substring(0, 150)}...
                        </div>
                      </Col>
                      <Col span={6} style={{ textAlign: 'right' }}>
                        {decision.biomarkers?.map(marker => (
                          <Tag key={marker} color="orange">{marker}</Tag>
                        ))}
                      </Col>
                    </Row>
                  </Card>
                </Col>
              ))}
            </Row>
          </Card>
        </TabPane>

        <TabPane tab="Timeline" key="3">
          <Row gutter={16}>
            <Col span={12}>
              <Card title="Travel Timeline">
                <Timeline>
                  {travelTimeline.map((period, index) => (
                    <Timeline.Item key={index}>
                      <div style={{ fontWeight: 'bold' }}>
                        {period.region} - {period.location}
                      </div>
                      <div style={{ fontSize: '12px', color: '#666' }}>
                        {moment(period.start_date).format('MMM DD')} - {moment(period.end_date).format('MMM DD, YYYY')}
                      </div>
                      <div style={{ fontSize: '12px' }}>
                        {period.events.length} events during this period
                      </div>
                    </Timeline.Item>
                  ))}
                </Timeline>
              </Card>
            </Col>
            
            <Col span={12}>
              <Card title="Exercise & Diagnostics">
                <Timeline>
                  {diagnostics.map((diagnostic, index) => (
                    <Timeline.Item key={`diag-${index}`} color="red">
                      <div style={{ fontWeight: 'bold' }}>Diagnostic Event</div>
                      <div style={{ fontSize: '12px', color: '#666' }}>
                        {moment(diagnostic.timestamp).format('MMM DD, YYYY')}
                      </div>
                      <div>
                        {diagnostic.biomarkers.map(marker => (
                          <Tag key={marker} size="small">{marker}</Tag>
                        ))}
                      </div>
                    </Timeline.Item>
                  ))}
                  {exerciseRefreshes.map((refresh, index) => (
                    <Timeline.Item key={`ex-${index}`} color="green">
                      <div style={{ fontWeight: 'bold' }}>Exercise Refresh</div>
                      <div style={{ fontSize: '12px', color: '#666' }}>
                        {moment(refresh.timestamp).format('MMM DD, YYYY')} - Week {refresh.week}
                      </div>
                    </Timeline.Item>
                  ))}
                </Timeline>
              </Card>
            </Col>
          </Row>
        </TabPane>

        <TabPane tab="Team Activity" key="4">
          <Row gutter={16}>
            {Object.entries(teamActivity).map(([name, stats]) => (
              <Col span={8} key={name}>
                <Card title={`${name} (${stats.role})`} style={{ marginBottom: 16 }}>
                  <div style={{ marginBottom: 16 }}>
                    <Progress 
                      percent={Math.min(100, (stats.total_messages / 20) * 100)} 
                      format={() => `${stats.total_messages} msgs`}
                    />
                  </div>
                  <Row>
                    <Col span={12}>
                      <Statistic title="Messages" value={stats.total_messages} />
                    </Col>
                    <Col span={12}>
                      <Statistic title="Decisions" value={stats.decisions_made} />
                    </Col>
                  </Row>
                  <div style={{ marginTop: 16 }}>
                    <div style={{ fontWeight: 'bold', marginBottom: 8 }}>Focus Areas:</div>
                    {Object.entries(stats.categories).slice(0, 3).map(([category, count]) => (
                      <Tag key={category} color="blue">{category} ({count})</Tag>
                    ))}
                  </div>
                </Card>
              </Col>
            ))}
          </Row>
        </TabPane>
      </Tabs>

      {/* Decision Modal */}
      <DecisionModal
        decision={selectedDecision}
        visible={!!selectedDecision}
        onClose={() => setSelectedDecision(null)}
      />

      {/* Event Detail Modal */}
      <Modal
        title="Event Details"
        visible={!!selectedEvent}
        onCancel={() => setSelectedEvent(null)}
        footer={[
          <Button key="close" onClick={() => setSelectedEvent(null)}>
            Close
          </Button>
        ]}
        width={800}
      >
        {selectedEvent && (
          <div>
            <div style={{ marginBottom: 16 }}>
              <Tag color="blue">{selectedEvent.actor.sender}</Tag>
              <Tag>{selectedEvent.actor.role}</Tag>
              <Tag color="green">{selectedEvent.topic.category}</Tag>
              <Tag>{selectedEvent.topic.subtype}</Tag>
            </div>
            
            <div style={{ marginBottom: 16 }}>
              <strong>Timestamp:</strong> {moment(selectedEvent.timestamp).format('YYYY-MM-DD HH:mm:ss')}
            </div>

            <div style={{ marginBottom: 16 }}>
              <strong>Details:</strong>
              <div style={{ marginTop: 8, padding: 12, backgroundColor: '#f5f5f5', borderRadius: 4 }}>
                {selectedEvent.content.details}
              </div>
            </div>

            {selectedEvent.why.rationale && (
              <div style={{ marginBottom: 16 }}>
                <strong>Rationale:</strong>
                <div style={{ marginTop: 8, padding: 12, backgroundColor: '#e6f7ff', borderRadius: 4 }}>
                  {selectedEvent.why.rationale}
                </div>
              </div>
            )}

            {selectedEvent.topic.biomarkers.length > 0 && (
              <div>
                <strong>Biomarkers:</strong>
                <div style={{ marginTop: 8 }}>
                  {selectedEvent.topic.biomarkers.map(marker => (
                    <Tag key={marker} color="orange">{marker}</Tag>
                  ))}
                </div>
              </div>
            )}
          </div>
        )}
      </Modal>
    </div>
  );
};

export default Dashboard;
